DROP TABLE IF EXISTS `accessrights`;
CREATE TABLE `accessrights`  (
  `accessId` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `pageId` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '菜单表主键',
  `roleId` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '角色表主键',
  `accessType` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '权限（info；add；modi；delete）',
  `accessValue` varchar(500) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `curStatus` int(11) NULL DEFAULT NULL,
  `recordName` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `recordTime` datetime NULL DEFAULT NULL,
  `modifyName` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `modifyTime` datetime NULL DEFAULT NULL,
  `deleteName` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `deleteTime` datetime NULL DEFAULT NULL,
  PRIMARY KEY (`accessId`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '系统表-权限设置表' ROW_FORMAT = Dynamic;

