-- ----------------------------
-- Table structure for fielddata
-- ----------------------------
DROP TABLE IF EXISTS `fielddata`;
CREATE TABLE `fielddata`  (
  `fieldName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '字段名',
  `fieldTitle` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '汉字名',
  `fieldType` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '字段类型 INT;VARCHAR;TEXT;DOUBLE;FLOAT;DATE;DATETIME 等',
  `fieldNum` int(32) NULL DEFAULT 0 COMMENT '字段长度',
  `fieldDigit` int(32) NULL DEFAULT 0 COMMENT '小数位数',
  `optionVal` varchar(1024) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '选项',
  `defaultVal` varchar(1024) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '默认值',
  `special` varchar(2046) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '特殊配置',
  `required` int(2) NULL DEFAULT 0 COMMENT '是否必填',
  `tableName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT 'not' COMMENT '表名（关联数据表表定义）',
  `sortNum` int(11) NULL DEFAULT NULL COMMENT '排序',
  `curStatus` int(2) NULL DEFAULT 2 COMMENT '状态字段（0：删除，2：正常）',
  `recName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '创建人',
  `recTime` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `modName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '修改人',
  `modTime` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `delName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '删除人',
  `delTime` datetime NULL DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`fieldName`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '系统表-字段定义表' ROW_FORMAT = Dynamic;

