-- ----------------------------
-- Table structure for filepermission
-- ----------------------------
DROP TABLE IF EXISTS `filepermission`;
CREATE TABLE `filepermission`  (
  `permissionId` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '权限id',
  `fileTypeId` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '文件类型',
  `actorType` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '角色类别',
  `contextValue` varchar(256) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '相关值',
  `see` int(2) NULL DEFAULT 1 COMMENT '查看权限 1可查看2不可查看',
  `download` int(2) NULL DEFAULT 1 COMMENT '下载权限 1可下载 2不可下载',
  `curStatus` int(6) NULL DEFAULT NULL,
  `recordName` varchar(36) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `recordTime` datetime NULL DEFAULT NULL,
  `modifyName` varchar(36) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `modifyTime` datetime NULL DEFAULT NULL,
  `deleteName` varchar(36) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `deleteTime` datetime NULL DEFAULT NULL,
  PRIMARY KEY (`permissionId`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '常用文件分类权限设置表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of filepermission
-- ----------------------------

-- ----------------------------
-- Table structure for filetype
-- ----------------------------
DROP TABLE IF EXISTS `filetype`;
CREATE TABLE `filetype`  (
  `fileTypeId` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '文件类型id',
  `fileTypeName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '文件类型名',
  `superiorFileTypeId` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '上级类型',
  `roleId` varchar(1024) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '角色id',
  `curStatus` int(2) NULL DEFAULT 2 COMMENT '状态字段（0：删除，2：正常）',
  `recordName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '创建人',
  `recordTime` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `modifyName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '修改人',
  `modifyTime` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `deleteName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '删除人',
  `deleteTime` datetime NULL DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`fileTypeId`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '常用文件分类' ROW_FORMAT = Dynamic;

