INSERT INTO `sp18110900001` VALUES ('Z2019022300001', '同意', '亲爱的同事： 为了提升个人能力，现公司决定不定期开展技术研讨会。此项活动作为2019年公司内部成员学习分享的重点，公司将大力推动活动发展。 分享内容不限、形式不限。可以是某一个框架的应用，也可以是某一个工具的使用，都可以报名开展此项活动。有意向者可提前与章总监沟通。 希望全体成员积极参与，有好的知识、好的技能，分享给大家，一起提升能力。此项活动将计入年度优秀个人及团队评选标准。', 2, NULL, NULL, 'FlowTask2019022300002', 'sp2018110900001', 'zhangxu', '2019-02-23 13:42:51', 'zhangxu', '2019-02-26 09:17:04', NULL, NULL, 'tangxiaoqing');

