-- ----------------------------
-- Table structure for taskdata
-- ----------------------------
DROP TABLE IF EXISTS `taskdata`;
CREATE TABLE `taskdata`  (
  `TaskName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '任务主键',
  `TaskTitle` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '任务名称 汉字名',
  `TaskType` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '任务类型 列表(0)、表单(1)',
  `tableName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '数据表 关联键（隐藏）',
  `taskField` varchar(1024) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '数据表字段 字段ID 有排序',
  `curStatus` int(2) NULL DEFAULT 2 COMMENT '状态字段（0：删除，2：正常）',
  `recName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '创建人',
  `recTime` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `modName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '修改人',
  `modTime` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `delName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '删除人',
  `delTime` datetime NULL DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`TaskName`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '系统表-任务定义' ROW_FORMAT = Dynamic;

