-- ----------------------------
-- Table structure for tasksender
-- ----------------------------
DROP TABLE IF EXISTS `tasksender`;
CREATE TABLE `tasksender`  (
  `workOrderNO` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '任务号',
  `sameOrderNO` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `wkflwID` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程定义号',
  `procID` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程运行号',
  `wkfNode` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `accepter` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '任务接受人',
  `refLinkUrl` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '页面跳转路径',
  `stress` int(11) NULL DEFAULT NULL COMMENT '任务级别',
  `msgStatus` int(11) NULL DEFAULT NULL COMMENT '任务通知状态（0：删除，1：未读，2：已读，3：处理中，4：已处完毕，5：暂定）',
  `taskTitle` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '任务名称',
  `linkKey` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '关联关键词',
  `linkRecordID` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '关联记录号',
  `remindTime` datetime NULL DEFAULT NULL COMMENT '提前提醒时间',
  `finishTime` datetime NULL DEFAULT NULL COMMENT '要求完成时间',
  `remindPeriod` double NULL DEFAULT NULL COMMENT '提醒周期',
  `curStatus` int(11) NULL DEFAULT NULL,
  `recordName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `recordTime` datetime NULL DEFAULT NULL,
  `modifyName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `modifyTime` datetime NULL DEFAULT NULL,
  `deleteName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `deleteTime` datetime NULL DEFAULT NULL,
  PRIMARY KEY (`workOrderNO`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '系统表-任务信息表' ROW_FORMAT = Dynamic;

