  `linkRecorderNO` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '关联字段',
  `curStatus` int(2) NULL DEFAULT 2 COMMENT '状态字段（0：删除，2：正常）',
  `workflowProcID` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '流程运行号',
  `workflowNodeID` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '流程节点ID',
