-- ----------------------------
-- Table structure for usermanager
-- ----------------------------
DROP TABLE IF EXISTS `usermanager`;
CREATE TABLE `usermanager`  (
  `userName` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '主键 登录名',
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '姓名',
  `password` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '密码',
  `computerIP` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '登录电脑IP',
  `staffId` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '用户信息表ID',
  `accountStatus` int(2) NULL DEFAULT 2 COMMENT '账号状态（1：账号停用，2：账号启用）',
  `userStatus` int(2) NULL DEFAULT 2 COMMENT '用户状态（1：临时账号，2：可登录，3：只允许本机登录）',
  `startDate` date NULL DEFAULT NULL,
  `endDate` date NULL DEFAULT NULL,
  `curStatus` int(2) NULL DEFAULT 2 COMMENT '0：删除，1：取消，2：显示',
  `recordName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '创建人',
  `recordTime` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `modifyName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '修改人',
  `modifyTime` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `deleteName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '删除人',
  `deleteTime` datetime NULL DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`userName`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '系统表-账号信息表' ROW_FORMAT = Dynamic;

