-- ----------------------------
-- Table structure for workflowdefine
-- ----------------------------
DROP TABLE IF EXISTS `workflowdefine`;
CREATE TABLE `workflowdefine`  (
  `wkflwID` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '流程定义号',
  `wkfName` varchar(48) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程名称',
  `wkfType` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程类别（市场经营；综合办公；人力资源；资产财务...）',
  `tableName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `wkfValue` longtext CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '流程图xml',
  `mailContent` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '邮件内容模板',
  `specialField` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '特殊处理字段',
  `pageId` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '发起页面菜单ID',
  `flowLabFld` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '流程任务模板',
  `flowLabFldliucheng` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '流程消息模板',
  `pkFeilds` varchar(127) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程全局主键',
  `wkfdefStatus` int(11) NULL DEFAULT 1 COMMENT '流程状态（0：取消，1：修改，2：发布）',
  `curStatus` int(11) NULL DEFAULT NULL,
  `recordName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `recordTime` datetime NULL DEFAULT NULL,
  `modifyName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `modifyTime` datetime NULL DEFAULT NULL,
  `deleteName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `deleteTime` datetime NULL DEFAULT NULL,
  PRIMARY KEY (`wkflwID`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '系统表-流程定义' ROW_FORMAT = Dynamic;

