-- ----------------------------
-- Table structure for workflowline
-- ----------------------------
DROP TABLE IF EXISTS `workflowline`;
CREATE TABLE `workflowline`  (
  `pathId` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '',
  `pathTitle` varchar(60) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `wkflwId` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程定义号',
  `fromNode` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '线开始节点',
  `toNode` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '线结束节点',
  `isJunction` bit(1) NULL DEFAULT b'0' COMMENT '待会合路径',
  `logUnitType` int(11) NULL DEFAULT NULL COMMENT '判断单元形式（1：无条件发送；2：指定字段为真:3：表达式为真:4：多个表达式为真:5：任一表达式为真）',
  `logUnitParams` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '判断单元参数',
  `logTypeOfByMultActor` int(11) NULL DEFAULT NULL COMMENT '多人判断条件方式（0：只需本人的填写符合本条件；1：只需一人的填写符合本条件；1：需所有人的填写符合本条件）',
  `isRebackPath` bit(1) NULL DEFAULT b'0' COMMENT '是退回/返回原发件人的路径',
  `sqlFeild` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '限定语句',
  `judgeAfterAll` bit(1) NULL DEFAULT b'0' COMMENT '所有人提交后才开始判断处理',
  `path1ToOtherTask` int(11) NULL DEFAULT 1 COMMENT '路径通时对其他同批任务的处理（0：撤消其他人的任务；1：其他人的任务继续）',
  `isAsynchPath` bit(1) NULL DEFAULT NULL COMMENT '是否是并行路径',
  `curStatus` int(11) NULL DEFAULT NULL,
  `recordName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `recordTime` datetime NULL DEFAULT NULL,
  `modifyName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `modifyTime` datetime NULL DEFAULT NULL,
  `deleteName` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `deleteTime` datetime NULL DEFAULT NULL,
  PRIMARY KEY (`pathId`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '系统表-流程线定义' ROW_FORMAT = Dynamic;

