-- ----------------------------
-- Table structure for workflowlog
-- ----------------------------
DROP TABLE IF EXISTS `workflowlog`;
CREATE TABLE `workflowlog`  (
  `wkflogId` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '流程日志表ID',
  `wkflowId` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程定义号',
  `procId` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程运行号',
  `nodeAction` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程动作类型（运行节点；取消流程；改派角色；暂停流程；恢复继续流程；流程回退）',
  `nodeID` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '节点ID',
  `inParams` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '入口数据',
  `outParams` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '输出数据',
  `success` bit(1) NULL DEFAULT b'0' COMMENT '是否成功',
  `reason` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '成功结果/失败原因',
  `addMessage` varchar(512) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '系统信息',
  `msgID` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '通知编号',
  `pkFeild` varchar(128) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '主键字段',
  `curStatus` int(11) NULL DEFAULT NULL,
  `recordName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `recordTime` datetime NULL DEFAULT NULL,
  `modifyName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `modifyTime` datetime NULL DEFAULT NULL,
  `deleteName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `deleteTime` datetime NULL DEFAULT NULL,
  PRIMARY KEY (`wkflogId`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '系统表-流程运行记录' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of workflowlog
-- ----------------------------

-- ----------------------------
-- Table structure for workflownode
-- ----------------------------
DROP TABLE IF EXISTS `workflownode`;
CREATE TABLE `workflownode`  (
  `nodeID` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '节点ID',
  `nodeTitle` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '节点名称',
  `needFormPage` bit(1) NULL DEFAULT b'1' COMMENT '是否为表单页面',
  `formId` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '页面关联键',
  `wkflwID` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程关联键',
  `nodePosition` tinyint(3) UNSIGNED NULL DEFAULT 0 COMMENT '节点位置',
  `maxWorkHouses` int(11) NULL DEFAULT NULL COMMENT '预警天数',
  `stress` int(6) NULL DEFAULT 3 COMMENT '级别（0：最低，1：较低，2：低，3：普通，4：高，5：较高，6：最高）',
  `workType` varchar(48) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '工作类别',
  `checkPageType` bit(1) NULL DEFAULT b'0' COMMENT '使用标准查验判断页面',
  `showInfoPages` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '查验判断所需表单页面',
  `flwNodeOpt` varchar(128) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '标准页面选项字段（同意，需修改，不同意）',
  `toSchedule` bit(1) NULL DEFAULT b'0' COMMENT '自动加入日程安排',
  `allowOtherDoit` bit(1) NULL DEFAULT b'0' COMMENT '允许接受人移交任务',
  `warnContent` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '预警内容',
  `isParellel` bit(1) NULL DEFAULT b'1' COMMENT '向本节点所有角色发送',
  `isORAction` bit(1) NULL DEFAULT b'0' COMMENT '本节点只需一人接受并执行',
  `actor1ByOne` bit(1) NULL DEFAULT NULL COMMENT '对每一个执行角色按顺序依次执行',
  `eachType1Only` bit(1) NULL DEFAULT NULL COMMENT '单一执行角色中只需一人处理',
  `security` int(11) NULL DEFAULT 0 COMMENT '记录密级（0：公开，1：保密，2：机密，3：绝密）',
  `reminder` varchar(128) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '提醒人（[节点处理人]，[流程发起人]，[运行管理员]）',
  `remindPeriod` double NULL DEFAULT NULL COMMENT '提醒周期',
  `remindType` varchar(8) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '提醒类型（系统信息，手机短信）',
  `remindTimeValue` double NULL DEFAULT NULL COMMENT '提醒提前值',
  `curStatus` int(6) NULL DEFAULT NULL,
  `recordName` varchar(36) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `recordTime` datetime NULL DEFAULT NULL,
  `modifyName` varchar(36) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `modifyTime` datetime NULL DEFAULT NULL,
  `deleteName` varchar(36) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `deleteTime` datetime NULL DEFAULT NULL,
  PRIMARY KEY (`nodeID`) USING BTREE,
