-- ----------------------------
-- Table structure for workflowproc
-- ----------------------------
DROP TABLE IF EXISTS `workflowproc`;
CREATE TABLE `workflowproc`  (
  `recorderNO` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `procId` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '流程运行号',
  `procTitle` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程运行名称',
  `wkflwID` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程定义号',
  `startNodeID` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '起始节点',
  `originator` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '发起人',
  `flowpeoples` varchar(2046) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程参与人',
  `nodespeople` varchar(2046) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '选择节点执行人',
  `wkfStatus` int(11) NULL DEFAULT NULL COMMENT '流程状态（0：启动；1：执行中:2：完成:3：取消:4：暂停:5：错误）',
  `curNodeID` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '当前节点',
  `wkfResult` int(11) NULL DEFAULT NULL COMMENT '流程结果（0：完成；1：失败；2：取消）',
  `endNodeID` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '终结节点',
  `security` int(11) NULL DEFAULT NULL COMMENT '记录密级（0：公开:1：保密:2：机密:3：绝密）',
  `runLevel` int(11) NULL DEFAULT 0 COMMENT '紧急程度（0：普通；1：紧急）',
  `curStatus` int(11) NULL DEFAULT NULL,
  `recordName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `recordTime` datetime NULL DEFAULT NULL,
  `modifyName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `modifyTime` datetime NULL DEFAULT NULL,
  `deleteName` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `deleteTime` datetime NULL DEFAULT NULL,
  PRIMARY KEY (`recorderNO`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '系统表-流程运行信息' ROW_FORMAT = Dynamic;

