DROP FUNCTION IF EXISTS `deptidstoname`;
delimiter ;;
CREATE FUNCTION `deptidstoname`(deptids VARCHAR(2000))
 RETURNS varchar(4000) CHARSET utf8 COLLATE utf8_bin
BEGIN
DECLARE oTemp VARCHAR(4000);
SET oTemp = '';
SELECT IFNULL(GROUP_CONCAT(deptName SEPARATOR ' '),deptids) INTO oTemp FROM department where deptId in (SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(deptids,';',help_topic_id+1),';',-1) AS num FROM mysql.help_topic WHERE help_topic_id < LENGTH(deptids)-LENGTH(REPLACE(deptids,';',''))+1);
RETURN oTemp;
END
;;
delimiter ;

