-- ----------------------------
-- Function structure for getChildrenOfDept
-- ----------------------------
DROP FUNCTION IF EXISTS `getChildrenOfDept`;
delimiter ;;
CREATE FUNCTION `getChildrenOfDept`(orgid VARCHAR(30))
 RETURNS varchar(4000) CHARSET utf8 COLLATE utf8_bin
BEGIN
DECLARE oTemp VARCHAR(4000);
DECLARE oTempChild VARCHAR(4000);

SET oTemp = '';
SET oTempChild = CAST(orgid AS CHAR);

WHILE oTempChild IS NOT NULL
DO
SET oTemp = CONCAT(oTemp,',',oTempChild);
SELECT GROUP_CONCAT(deptId) INTO oTempChild FROM department WHERE FIND_IN_SET(superiorDeptId,oTempChild) > 0;
END WHILE;
RETURN oTemp;
END
;;
delimiter ;

-- ----------------------------
-- Function structure for getMonthDate
-- ----------------------------
DROP FUNCTION IF EXISTS `getMonthDate`;
delimiter ;;
CREATE FUNCTION `getMonthDate`(sdate VARCHAR ( 20 ))
 RETURNS varchar(4000) CHARSET utf8 COLLATE utf8_bin
BEGIN
DECLARE result VARCHAR ( 4000 );

SELECT GROUP_CONCAT(date_add( sdate, INTERVAL ( cast( help_topic_id AS signed INTEGER ) ) DAY )) INTO result FROM mysql.help_topic WHERE help_topic_id < DAY ( last_day( sdate ) ) ;

RETURN result;

END
;;
delimiter ;

