-- ----------------------------
-- Function structure for selectidtoname
-- ----------------------------
DROP FUNCTION IF EXISTS `selectidtoname`;
delimiter ;;
CREATE FUNCTION `selectidtoname`(_fieldname varchar(100),_val varchar(100))
 RETURNS varchar(2000) CHARSET utf8 COLLATE utf8_bin
BEGIN
	DECLARE oTemp VARCHAR(4000);
	SET oTemp = '';
	SELECT GROUP_CONCAT(`id` SEPARATOR ' ') AS `name` INTO oTemp FROM
	(SELECT CASE WHEN LOCATE(';',tb.NAME)>0 THEN (SELECT get_splitted_substring(tb.NAME,';',1)) ELSE (SELECT tb.NAME) END AS `id`,CASE WHEN LOCATE(';',tb.NAME)>0 THEN (SELECT get_splitted_substring(tb.NAME,';',2)) ELSE (SELECT tb.NAME) END AS `name`
	FROM (SELECT  SUBSTRING_INDEX(SUBSTRING_INDEX((SELECT optionVal FROM fielddata WHERE fieldname=_fieldname),'\n',help_topic_id+1),'\n',-1) AS NAME FROM mysql.help_topic WHERE help_topic_id < (select LENGTH(optionVal)-LENGTH(REPLACE(optionVal,'\n',''))+1 from fielddata where fieldname=_fieldname LIMIT 0,1)) tb
	) as a WHERE `id` = _val;
	RETURN oTemp;
END
;;
delimiter ;

-- ----------------------------
-- Function structure for selectsidtoname
-- ----------------------------
DROP FUNCTION IF EXISTS `selectsidtoname`;
delimiter ;;
CREATE FUNCTION `selectsidtoname`(_fieldname varchar(100),_val varchar(100))
 RETURNS varchar(2000) CHARSET utf8 COLLATE utf8_bin
BEGIN
	DECLARE oTemp VARCHAR(4000);
	SET oTemp = '';
	SELECT GROUP_CONCAT(IFNULL(`name`,`id`) SEPARATOR ' ') AS `name` INTO oTemp FROM
	(SELECT 
		(select substring_index(substring_index((SUBSTRING_INDEX(SUBSTRING_INDEX((select optionVal from fielddata where fieldname=_fieldname),'\n',help_topic_id+1),'\n',-1)),';',1),';',-1)) `id`,
		(select substring_index(substring_index((SUBSTRING_INDEX(SUBSTRING_INDEX((select optionVal from fielddata where fieldname=_fieldname),'\n',help_topic_id+1),'\n',-1)),';',2),';',-1)) `name` 
	FROM mysql.help_topic WHERE help_topic_id < (select LENGTH(optionVal)-LENGTH(REPLACE(optionVal,'\n',''))+1 from fielddata where fieldname=_fieldname LIMIT 0,1)) as a 
	WHERE `id` IN (SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(_val,',',help_topic_id+1),',',-1) AS num FROM mysql.help_topic WHERE help_topic_id < LENGTH(_val)-LENGTH(REPLACE(_val,',',''))+1);
	RETURN oTemp;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for select_userkq
-- ----------------------------
DROP PROCEDURE IF EXISTS `select_userkq`;
delimiter ;;
CREATE PROCEDURE `select_userkq`(_username2 VARCHAR(200),_year VARCHAR(20), 
		 _month VARCHAR(20), 
		 time1 VARCHAR(18), 
		 time2 VARCHAR(18), 
		time3 VARCHAR(18), 
		 time4 VARCHAR(18), 
		 time5 VARCHAR(18), 
		 time6 VARCHAR(18), 
		 time7 VARCHAR(18), 
		 time8 VARCHAR(18))
BEGIN
    DECLARE done INT UNSIGNED DEFAULT 0;
		DECLARE sname VARCHAR(50);
    DECLARE datetime1 VARCHAR(50);
		DECLARE datetime2 VARCHAR(50);
		DECLARE datetime3 VARCHAR(50);
		DECLARE datetime4 VARCHAR(50);
		DECLARE datetime5 VARCHAR(50);
		DECLARE datetime6 VARCHAR(50);
		DECLARE datetime7 VARCHAR(50);
		DECLARE datetime8 VARCHAR(50);
	 	DROP TEMPORARY TABLE IF EXISTS tmp_table;
		CREATE TEMPORARY TABLE tmp_table (`name` VARCHAR(20),`staffname` VARCHAR(20),`day` VARCHAR(20),swsb VARCHAR(20),swsbh VARCHAR(20),swxbq VARCHAR(20),swxb VARCHAR(20),xwsb VARCHAR(20),xwsbh VARCHAR(20),xwxbq VARCHAR(20),xwxb VARCHAR(20));
		SET sname = useridtoname(_username2);
		 repeat  
		  SET done = done+1;
			SET datetime1 = concat(_year,'-',_month,'-',done,' ',time1);
			SET datetime2 = concat(_year,'-',_month,'-',done,' ',time2);
			SET datetime3 = concat(_year,'-',_month,'-',done,' ',time3);
			SET datetime4 = concat(_year,'-',_month,'-',done,' ',time4);
			SET datetime5 = concat(_year,'-',_month,'-',done,' ',time5);
			SET datetime6 = concat(_year,'-',_month,'-',done,' ',time6);
			SET datetime7 = concat(_year,'-',_month,'-',done,' ',time7);
			SET datetime8 = concat(_year,'-',_month,'-',done,' ',time8);
      INSERT INTO tmp_table  (
      SELECT `name`,sname as staffname,`day`,swsb,swsbh,swxbq,swxb,xwsb,xwsbh,xwxbq,xwxb FROM (
			SELECT (SELECT DISTINCT sbry190720001 FROM rlsbview WHERE curStatus=2 AND sbry190720001 = _username2 ) AS `name`,done AS `day`
			,IFNULL((SELECT MIN(sbsj190720001) FROM rlsbview WHERE curStatus=2 AND sbry190720001=_username2 AND sbsj190720001 BETWEEN datetime1 AND datetime2),'') AS swsb
			,IFNULL((SELECT MIN(sbsj190720001) FROM rlsbview WHERE curStatus=2 AND sbry190720001=_username2 AND sbsj190720001 BETWEEN datetime2 AND datetime3),'') AS swsbh
			,IFNULL((SELECT MAX(sbsj190720001) FROM rlsbview WHERE curStatus=2 AND sbry190720001=_username2 AND sbsj190720001 BETWEEN datetime2 AND datetime3),'') AS swxbq
			,IFNULL((SELECT MIN(sbsj190720001) FROM rlsbview WHERE curStatus=2 AND sbry190720001=_username2 AND sbsj190720001 BETWEEN datetime3 AND datetime4),'') AS swxb
			,IFNULL((SELECT MIN(sbsj190720001) FROM rlsbview WHERE curStatus=2 AND sbry190720001=_username2 AND sbsj190720001 BETWEEN datetime5 AND datetime6),'') AS xwsb
			,IFNULL((SELECT MIN(sbsj190720001) FROM rlsbview WHERE curStatus=2 AND sbry190720001=_username2 AND sbsj190720001 BETWEEN datetime6 AND datetime7),'') AS xwsbh
			,IFNULL((SELECT MAX(sbsj190720001) FROM rlsbview WHERE curStatus=2 AND sbry190720001=_username2 AND sbsj190720001 BETWEEN datetime6 AND datetime7),'') AS xwxbq
			,IFNULL((SELECT MAX(sbsj190720001) FROM rlsbview WHERE curStatus=2 AND sbry190720001=_username2 AND sbsj190720001 BETWEEN datetime7 AND datetime8),'') AS xwxb 
			FROM DUAL
			) aa);
		 until done>=31 end repeat;  
		 select * from tmp_table;
END
;;
delimiter ;

